  // Delete Sales Order Dialog events
  bmlfonDialogAction(psAction) {
    if (psAction == 'No') {
      this.mbShowDeleteDialog = false;
    } else if (psAction == 'Yes') {
      if (this.mnumGridIndex != undefined && this.mnumGridIndex != -1) {
        if (this.marrGridData[this.mnumGridIndex].Custom1 != '' && this.marrGridData[this.mnumGridIndex].Custom1 != null) {
          this.bmlfOpenErrorBlock('CUSTOMFIELDCONFIGUE.MSG.ROWDELETEDFROMSOURCEONLY');
          this.mbShowDeleteDialog = false;
          return;
        }
      }
      let parrHeaderData = [];
      if (this.mbIsFooterDelete == true) {
        parrHeaderData = [{
          ScreenName: this.mobjCustomFieldModal.ScreenName,
          CompanyID: this.mobjCustomFieldModal.CompanyID,
          Customization: this.mbIsHeader ? "" : this.mobjCustomFieldModal.GridName,
          ControlName: "",
          FieldName: "",
          GridName: this.mbIsHeader ? "" : this.mobjCustomFieldModal.GridName,
          GridIndex: -1,
          Isdbchange: !this.mbIsHideFromScreen,
          DataType: ""
        }];
      } else {
        let pobj = this.marrGridData[this.mnumGridIndex];
        parrHeaderData = [{
          ScreenName: this.mobjCustomFieldModal.ScreenName,
          CompanyID: this.mobjCustomFieldModal.CompanyID,
          Customization: this.mbIsHeader ? "" : this.mobjCustomFieldModal.GridName,
          ControlName: pobj.ControlName,
          FieldName: pobj.FieldName,
          GridName: this.mbIsHeader ? "" : this.mobjCustomFieldModal.GridName,
          GridIndex: -1,
          Isdbchange: !this.mbIsHideFromScreen,
          DataType: pobj.DataType
        }];
      }
      this.mbIsLoading = true;
      let reqData = {
        JSON: JSON.stringify({
          ParaData: parrHeaderData,
          Response: [{
            "ResponseText": "",
            "ErrorCode": ""
          }]
        })
      };
      this.formService.bmlfDeleteCustomizationTool(reqData, this.mbIsFooterDelete).subscribe(res => {
        this.mbIsLoading = false;
        if (res == null) {
          this.toastMessageService.notifyError(this.utilService.bmgfonTranslate('COMMON.MSG.SERVERERROR'));
          return false;
        }
        if (res.Response[0].ErrorCode == "") {
          {
            if (this.mbIsFooterDelete == true) {
              this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate('COMMON.MSG.DELETE'));
              this.bmlfClearForm();
            } else {
              this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate('COMMON.MSG.DELETEDLINE'));
              let parrArrData = Object.assign([], this.marrGridData);
              parrArrData.splice(this.mnumGridIndex, 1);
              this.mnumGridIndex = -1;
              this.marrGridData = parrArrData;
            }
            this.mbShowDeleteDialog = false;
          }
        } else {
          this.toastMessageService.notifyError(res.Response[0].ResponseText);
          this.mbShowDeleteDialog = false;
        }
      });
    }
  }
