  // On Global Focus
  bmlfOnGlobalFocus(field, value) {
    if (typeof value === 'object' && value.constructor === Object) {
      let valueCopy = Object.assign({}, value);
      this.msLookupField = valueCopy[field];
    } else {
      this.msLookupField = value;
    }
  }
  // Save Lookup Field
  bmlfSaveLookupField(pobjEvent) {
    this.mbIsLookupModal = false;
    if (pobjEvent.type == 'custom') {
      if (pobjEvent.field == "UserValidation") {
        this.bmlfOpenSelectedRecord(pobjEvent.value);
        this.mbChange = false;
      }
      if (pobjEvent.field == 'CompanyName') {
        this.mobjUserValidDataModel.CompanyID = pobjEvent.valueKey;
        this.msCompanyID = pobjEvent.valueKey;
        this.msTenantId = pobjEvent.value.TenantID;
        this.mobjUserValidDataModel.User1 = this.msTenantId;
        this.bmlfSetCompanyNameGlobally();
      } else if (pobjEvent.field == 'Module') {
        this.mobjUserValidDataModel.Module = pobjEvent.valueKey;
        this.msModuleName = pobjEvent.value.ModuleCode;
        this.mobjUserValidDataModel.Screen = "";
        this.mbChange = true;
      } else if (pobjEvent.field == 'Screen') {
        this.mobjUserValidDataModel.Screen = pobjEvent.valueKey;
        this.mbChange = true;
      } else if (pobjEvent.field == 'Group') {
        this.mobjUserValidDataModel.UserId = pobjEvent.valueKey;
        this.mbChange = true;
      } else if (pobjEvent.field == 'EventButton') {
        this.mobjUserValidDataModel.ButtonCaption = pobjEvent.value.ControlName;
        this.mbChange = true;
      } else if (pobjEvent.field == 'Source') {
        this.gridDataList[this.mnumLineItemRowIndex]['Source'] = pobjEvent.value.GuiCaption;
        this.mbChange = true;
      }
    }
  }
