  bmlfSaveUserValidation() {
    this.mbIsLoading = true;
    let data = this.utilService.bmgfCustomModelTransform(this.customCtrl);
    this.bmlfonAssignCustValues(data);
    this.mobjUserValidDataModel.Active = this.mbCheckActive ? 'Active' : 'InActive';
    this.mobjUserValidDataModel.User1 = this.msTenantId; // For Store Tenant Id
    // if (this.mbCheckActive == true) {
    //   this.mobjUserValidDataModel.Active = 'Active'
    // }
    this.mobjUserValidDataModel.ScreenType = 'VAL';
    let parrHeaderData = [];
    parrHeaderData.push(Object.assign({}, this.mobjUserValidDataModel));
    let pobjJData = {
      HeaderData: parrHeaderData,
      DetailData: this.gridDataList,
      Response: [{
        "ResponseText": "",
        "ErrorCode": ""
      }]
    };
    let reqData = {
      JSON: JSON.stringify(pobjJData)
    };
    this.formService.bmlfSaveUserValidation(reqData).subscribe(res => {
      this.mbIsLoading = false;
      if (res == null) {
        this.toastMessageService.notifyError(this.utilService.bmgfonTranslate('COMMON.MSG.SERVERERROR'));
        return false;
      }
      if (res.Response[0].ErrorCode == "") {
        this.mbChange = false;
        this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate("COMMON.MSG.SAVE"));
        if (this.msFormMode == "I") {
          this.msFormMode = "U";
          this.mobjUserValidDataModel = res.HeaderData[0];
          if (this.mobjUserValidDataModel.Active == 'Active') {
            this.mobjUserValidDataModel.Active = true;
          } else {
            this.mobjUserValidDataModel.Active = false;
          }
          let parrGridData = res.DetailData;
          this.gridDataList = parrGridData;
        }
        if (this.mbIsInsertMode) {
          ///Bug 194334
          this.bmlfonURL(this.mobjUserValidDataModel.UserFormulaID, this.mobjUserValidDataModel.CompanyID);
        } else if (this.mbIsCloseMode) {
          this.mbIsCloseMode = false;
          this.router.navigate(["/main/admin/admin"]);
        } else if (this.mbIsSearchMode) {
          this.mbIsSearchMode = false;
          this.bmlfOpenLookupModal('UserValidation', this.msScreenName, 'UserValidationList', 'click', '', 'custom', 'User Validation Lookup', 'txtUserValidID', '');
        } else if (this.mbIsCopyMode) {
          this.mbIsCopyMode = false;
          this.bmlfCopyData();
        }
        this.bmlfGetUserValidData(); // Bug 190011
      } else {
        this.mbIsDeleteMode = false;
        this.mbIsCloseMode = false;
        this.toastMessageService.notifyError(res.Response[0].ResponseText);
      }
      console.log(res);
    }).add(() => {
      this.mbIsLoading = false;
    });
  }
