  // For Show Title on Check Function Type
  bmlfonCheckType(psValue) {
    this.msSourceValType = psValue;
    this.msSourceValFind = '';
    this.msSourceValLenght = '';
    this.msSourceValStart = '';
    this.msSourceValReplace = '';
    if (psValue == "Sum") {
      this.msTypeSummary = 'Add all the numbers in a Range of Cells';
      this.msReturnType = 'Number';
      this.msSourceMainValue = '';
      this.msSourceMainValue = psValue + '(' + this.msSourceValue + ')';
    } else if (psValue == "Average") {
      this.msTypeSummary = 'Returns the average(arithmetic mean) of the argument';
      this.msReturnType = 'Number';
      this.msSourceMainValue = psValue + '(' + this.msSourceValue + ')';
    } else if (psValue == "Min") {
      this.msTypeSummary = 'Returns the smallest number in a set values';
      this.msReturnType = 'Number';
      this.msSourceMainValue = psValue + '(' + this.msSourceValue + ')';
    } else if (psValue == "Max") {
      this.msTypeSummary = 'Returns largest vlaue in a set of values';
      this.msReturnType = 'Number';
      this.msSourceMainValue = psValue + '(' + this.msSourceValue + ')';
    } else if (psValue == "Len") {
      this.msTypeSummary = 'Returns string length or bytes required to store a variable';
      this.msReturnType = 'String';
      this.msSourceMainValue = psValue + '(' + this.msSourceValue + ')';
    } else if (psValue == "Mid") {
      this.msTypeSummary = 'Returns string length or bytes required to store a variable';
      this.msReturnType = 'String';
      this.msSourceMainValue = psValue + '(' + this.msSourceValue + ',' + this.msSourceValStart + ',' + this.msSourceValLenght + ')';
    } else if (psValue == "Left") {
      this.msTypeSummary = 'Returns specified number of characters from the left side of the string';
      this.msReturnType = 'String';
      this.msSourceMainValue = this.msSourceValType + '(' + this.msSourceValue + ',' + this.msSourceValStart + ',' + this.msSourceValLenght + ')';
    } else if (psValue == "Right") {
      this.msTypeSummary = 'Returns specified number of characters from the Right side of the string';
      this.msReturnType = 'String';
      this.msSourceMainValue = this.msSourceValType + '(' + this.msSourceValue + ',' + this.msSourceValStart + ',' + this.msSourceValLenght + ')';
    } else if (psValue == "Replace") {
      this.msTypeSummary = 'Find and replace a substring with a string';
      this.msReturnType = 'String';
      this.msSourceValFind = this.msSourceValue;
    } else if (psValue == "Trim") {
      this.msTypeSummary = 'Returns a copy of a string without leading and trailing spaces';
      this.msReturnType = 'String';
    } else if (psValue == "Ucase") {
      this.msTypeSummary = 'Returns a specified string, converted to uppercase';
      this.msReturnType = 'String';
    }
    //this.msParamSource = psValue
  }

